pragma solidity >=0.4.23 <0.6.0;

import 'openzeppelin-solidity/contracts/ownership/Ownable.sol';
import './StringUtils.sol';

contract Certificates is Ownable {
  using StringUtils for string;

  mapping(bytes32 => mapping(bytes32 => Student)) certificates;
  mapping(bytes32 => mapping(bytes32 => string[2])) hashes;

  struct Student {
    string studentId;
    string studentName;
    string studentEmail;
    string courseId;
    string courseName;
    string courseIntensity;
    string courseStartDate;
    string courseFinishDate;
  }

  event studentCertified(
    bytes32 indexed _studentId,
    bytes32 _part1,
    bytes32 _part2
  );

  function certify(
    string memory _studentId,
    string memory _studentName,
    string memory _studentEmail,
    string memory _courseId,
    string memory _courseName,
    string memory _courseIntensity,
    string memory _courseStartDate,
    string memory _courseFinishDate,
    string memory _certificateHashPart1,
    string memory _certificateHashPart2,
    string memory _linkHashPart1,
    string memory _linkHashPart2
  ) public onlyOwner {
    bytes32 part1 = _certificateHashPart1.stringToBytes32();
    bytes32 part2 = _certificateHashPart2.stringToBytes32();
    certificates[part1][part2] = Student({
      studentId : _studentId,
      studentName : _studentName,
      studentEmail : _studentEmail,
      courseId : _courseId,
      courseName : _courseName,
      courseIntensity : _courseIntensity,
      courseStartDate : _courseStartDate,
      courseFinishDate : _courseFinishDate
      });
    emit studentCertified(_studentId.stringToBytes32(), part1, part2);
    setHashRelationship(_linkHashPart1, _linkHashPart2, _certificateHashPart1, _certificateHashPart2);
  }

  function setHashRelationship(
    string memory _linkHashPart1,
    string memory _linkHashPart2,
    string memory _certificateHashPart1,
    string memory _certificateHashPart2
  ) private {
    hashes[_linkHashPart1.stringToBytes32()][_linkHashPart2.stringToBytes32()] = [_certificateHashPart1, _certificateHashPart2];
  }

  function verifyByIPFS(
    string memory _certificateHashPart1,
    string memory _certificateHashPart2
  ) public view returns (string memory, string memory, string memory, string memory, string memory, string memory) {
    bytes32 part1 = _certificateHashPart1.stringToBytes32();
    bytes32 part2 = _certificateHashPart2.stringToBytes32();
    Student memory student = certificates[part1][part2];
    return (
    student.studentId,
    student.studentName,
    student.courseName,
    student.courseIntensity,
    student.courseStartDate,
    student.courseFinishDate
    );
  }

  function verifyByLink(
    string memory _linkHashPart1,
    string memory _linkHashPart2
  ) public view returns (string memory, string memory, string memory, string memory, string memory, string memory) {
    bytes32 part1 = _linkHashPart1.stringToBytes32();
    bytes32 part2 = _linkHashPart2.stringToBytes32();
    string[2] memory IPFSHashes = hashes[part1][part2];
    return verifyByIPFS(IPFSHashes[0], IPFSHashes[1]);
  }

  function kill() public onlyOwner {
    selfdestruct(address( int160( owner() ) ));
  }
}
